import React from 'react';
import {AppBar, Toolbar,Typography,CssBaseline, Container, Box} from '@material-ui/core';
import imgLogo from './images/spectrum_logo.png'
import './App.css';

function App() {
  return (
    <div className="App">
    <CssBaseline />
    <AppBar>
      <Toolbar>                  
        <img src={imgLogo} alt="spectrum global" with="50px" height="50px" /><Typography variant="h6">Spectrum Global Events Calender</Typography>
      </Toolbar>
    </AppBar>
    <Toolbar />
    <Container>
      <Box my={2}>{                    
            <h2>Spectrum global events</h2>                 
        }
      </Box>
    </Container>    
  </div>
  );
}

export default App;
